import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';


const useStyles = makeStyles(theme => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
    imageDiv:{
        margin: "10px"
    }
}));

export default function FolderList() {
    const classes = useStyles();

    return (
        <List className={classes.root}>
        <ListItem>
            <div className = {classes.imageDiv}><img src = {require("./../../images/logo_2x1.png")}></img></div>
            <div className = {classes.manfId}>Manufacturer Id: 12345</div>
            <div className = {classes.date}>Date: 12/12/2019</div>
        </ListItem>
        <ListItem>
            <ListItemText primary="Company" secondary="Steelbird Pvt. Lmt." />
        </ListItem>
        <ListItem>
            <ListItemText primary="Phone" secondary="8965784523" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Email" secondary="steelbird@gmail.com" />
        </ListItem>
        <ListItem>
            <ListItemText primary="Address" secondary="Bengaluru" />
        </ListItem>
        </List>
    );
}
